import styled from "styled-components";
import { Page } from "./styles";
import headshot from '../../images';

const NameBanner = styled.div`
  display: flex;
  height: 60rem;
  align-items: center;
  justify-content: center;
`;

const NameText = styled.h1`
  font-size: 10.5rem;
`;

export const Home = () => {
  return (
    <Page>
      <NameBanner>
        <NameText>Kayti Jackson</NameText>
        <Headshot />
      </NameBanner>
    </Page>
  );
};
